import React from "react";

export default function Credit() {
  return (
    <div className="credit">
      <p>
        Coded by 
        <a href="https://github.com/vcr11" target="_blank" rel="noopener noreferrer">
           Chandra Shekar Reddy Vangala
        </a>
      </p>
    </div>
  );
}
